import {Container, Row} from "react-bootstrap";
import React from "react";

function Home() {
    return (
        <Container className="flex-center position-ref full-height" fluid>
            <Row className="justify-content-md-center">
                <h1>Bienvenue</h1>
            </Row>
        </Container>
    );
}

export default Home;
